import 'user.dart';class AuthModel {  User user;  String authToken;  AuthModel({this.user, this.authToken});  AuthModel.fromJson(Map<String, dynamic> json) {    user = json['user'] != null ? User.fromJson(json['user']) : null;    authToken = json['authToken'];  }  Map<String, dynamic> toJson() {    final data = <String, dynamic>{};    if (this.user != null) {      data['user'] = this.user.toJson();    }    data['authToken'] = this.authToken;    return data;  }}